            <div className={styles.options}>
                <p>Good: {good}</p>
                <p>Neutral: {neutral}</p>
                <p>Bad: {bad}</p>
                <p>Total:</p>
                <p>Positive feedback:</p>
            </div>
        </div>
    )
}

